import react from "react";
import Userlist from "../userslist";

const User = () => {
  const USERS = [
    {
      id: "u1",
      name: "dev",
      image: 'https://img.freepik.com/free-photo/portrait-lion-ai-generated_268835-4278.jpg',
      places: 3,
    },
  ];

  return <Userlist items={USERS} />;
};

export default User;
